import React from 'react';
import Navbar from './Navbar';

class App extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <h1>Welcome to my React App!</h1>
        {/* Add the content for different pages below */}
        {/* Home page */}
        <div id="home">
          <h2>Home</h2>
          <p>This is the home page.</p>
        </div>
        {/* Contact Us page */}
        <div id="contact">
          <h2>Contact Us</h2>
          <p>This is the contact us page.</p>
        </div>
        {/* Service page */}
        <div id="service">
          <h2>Service</h2>
          <p>This is the service page.</p>
        </div>
        {/* Portfolio page */}
        <div id="portfolio">
          <h2>Portfolio</h2>
          <p>This is the portfolio page.</p>
        </div>
      </div>
    );
  }
}

export default App;
